import React from 'react';
import { useState } from "react";

function Footer() {
    const [state] = useState({main_header: 'PAWNI KHANNA', text: 'lets get connected'})
    return (
        <div className="footer">
            <div className="container">
                <div className="footerSection">
                    <div className="footer_img">
                        <img src="/images/profile.jpeg" alt="" />
                        <div className="common">
                            <h1 className="white_main_header">{state.main_header}</h1>
                            <div className="white_common_border"></div>
                            <p className="white_main_content">{state.text}</p>
                            <p className="whit">{state.text}</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Footer
